CREATE PROCEDURE dbo.proc_transform_409
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_409
    SET payload = LEFT(payload, 1000) + N'|V4-409|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_409;
END
